import React from 'react'

function Todo() {
  return (
    <div className='bg-red-600'>
        <div className=' text-center pt-10'>
        <h1 className='font-bold text-7xl text-black bg-gradient-to-r from-white to-white'>ToDo App </h1>
        </div>
    </div>
  )
}

export default Todo
